        [HttpPost]
        public ActionResult EliminarPelicula(EliminarPelicula pelicula)
        {
            if (pelicula.NombrePeliculaEliminar != null)
            {
                ArbolBPlus<string, string> arbolBPlusPeliculas = new ArbolBPlus<string, string>(4);
                List<string> listaNombre = new List<string>();
                List<string> listaTipo = new List<string>();
                List<string> listaAño = new List<string>();
                List<string> listaGenero = new List<string>();
                List<string> PeliculasMostrar = new List<string>();
                List<string> JsonPeliculas = new List<string>();
                string tipo = "";
                var location2 = @" C:\Proyecto1\Peliculas.txt";
                var location = @" C:\Proyecto1\Peliculas.tree";
                if (System.IO.File.Exists(location))
                {
                    #region
                    //Extrar Informacion del arbol de peliculas   

                    using (StreamReader leer = new StreamReader(location))
                    {
                        int i = 0;
                        while (!leer.EndOfStream)
                        {
                            string x = leer.ReadLine();
                            JsonPeliculas.Add(x);
                            i++;
                        }
                    }

                    //Desearializar json
                    for (int i = 0; i < JsonPeliculas.Count; i++)
                    {
                        Peliculas peliculas = JsonConvert.DeserializeObject<Peliculas>(JsonPeliculas.ElementAt(i));
                        listaTipo.Add(peliculas.Tipo);
                        listaNombre.Add(peliculas.Nombre);
                        listaAño.Add(peliculas.AñoLanzamiento);
                        listaGenero.Add(peliculas.Genero);
                        PeliculasMostrar.Add("Tipo: " + listaTipo.ElementAt(i) + ", Nombre: " + listaNombre.ElementAt(i) + ", Año: " + listaAño.ElementAt(i) + ", Genero: " + listaGenero.ElementAt(i));
                    }
                    if (PeliculasMostrar.Count > 1)
                    {
                        for (int i = 0; i < JsonPeliculas.Count; i++)
                        {
                            arbolBPlusPeliculas.Insertar(listaNombre.ElementAt(i), JsonPeliculas.ElementAt(i));
                        }
                    }
                    #endregion

                    string eliminar = pelicula.NombrePeliculaEliminar;
                    bool condicion = false;
                    int posicion = 0;
                    int CondicionTipo = 0;

                    //Validar que la pelicula que el admin desee eliminar sea de documental,pelicula o show y que exista en la base de datos.
                    for (int i = 0; i < listaNombre.Count; i++)
                    {
                        if (eliminar == listaNombre.ElementAt(i))
                        {
                            condicion = true;
                            posicion = i;
                            tipo = listaTipo.ElementAt(i);
                            if(tipo == "documental"||tipo == "Documental")
                            {
                                CondicionTipo = 1;                            
                            }
                            if (tipo == "show" || tipo == "Show")
                            {
                                CondicionTipo = 2;
                            }
                            if (tipo == "pelicula" || tipo == "pel�cula" || tipo == "pelicula"|| tipo == "Pelicula" || tipo == "Pel�cula" || tipo == "Pelicula")
                            {
                                CondicionTipo = 3;
                            }                       
                            break;
                        }
                    }

                    if (condicion == true)
                    { 
                        //Remover la pelicula solicitad
                        JsonPeliculas.Remove(JsonPeliculas.ElementAt(posicion));
                        listaNombre.Remove(listaNombre.ElementAt(posicion));
                        listaAño.Remove(listaAño.ElementAt(posicion));
                        listaGenero.Remove(listaGenero.ElementAt(posicion));
                        listaTipo.Remove(listaTipo.ElementAt(posicion));                        
                        arbolBPlusPeliculas.Eliminar(eliminar);

                        for (int i = 0; i < listaNombre.Count; i++)
                        {
                            PeliculasMostrar.Add("Tipo: " + listaTipo.ElementAt(i) + ", Nombre: " + listaNombre.ElementAt(i) + ", Año: " + listaAño.ElementAt(i) + ", Genero: " + listaGenero.ElementAt(i));
                        }

                        using (StreamWriter WrEliminar = new StreamWriter(location))
                        {
                            for (int i = 0; i < JsonPeliculas.Count; i++)
                            {
                                WrEliminar.WriteLine(JsonPeliculas.ElementAt(i));
                            }
                            WrEliminar.Close();
                        }

                        //Almacenar los cambios con la pelicula eliminada en el archivo de peliculas del arbol.
                        var list = new List<KeyValuePair<string, string>>();
                        list.Add(new KeyValuePair<string, string>("B", "A"));
                        List<string> MostrarArbol = new List<string>();
                        Nodo<string, string> pivote = arbolBPlusPeliculas.EncontrarHojaPorKey(list.ElementAt(0).Key);
                        if (pivote != null)
                        {
                            if (pivote.Valores != null)
                            {
                                for (int i = 0; i < pivote.Valores.Count; i++)
                                {
                                    MostrarArbol.Add(pivote.Valores.ElementAt(i).ToString());
                                }
                            }
                            //hojas derechas
                            #region
                            if (pivote.NodoHojaDerecho != null)
                            {
                                for (int i = 0; i < pivote.NodoHojaDerecho.Valores.Count; i++)
                                {
                                    MostrarArbol.Add(pivote.NodoHojaDerecho.Valores.ElementAt(i).ToString());
                                }
