        [HttpPost]
        public ActionResult BuscarPeliUsuario(BuscarPelicula buscar)
        {
            if (buscar.IngresarNombrePelicula != null)
            {
                if (System.IO.File.Exists(@"C:\Proyecto1\Peliculas.tree"))
                {

                    ArbolBPlus<string, string> arbolBPlusPeliculas = new ArbolBPlus<string, string>(4);                               
                    List<string> JsonPeliculas = new List<string>();
                    List<string> listaNombre = new List<string>();
                    var location3 = @" C:\Proyecto1\Peliculas.tree";

                    //Extrar informacion del archivo de peliculas del arbol
                    using (StreamReader leer = new StreamReader(location3))
                    {
                        int i = 0;
                        while (!leer.EndOfStream)
                        {
                            string x = leer.ReadLine();
                            JsonPeliculas.Add(x);
                            i++;
                        }
                    }

                    //Desearializar json y almacenar en arbol 
                    for (int i = 0; i < JsonPeliculas.Count; i++)
                    {                     
                        Peliculas peliculas = JsonConvert.DeserializeObject<Peliculas>(JsonPeliculas.ElementAt(i));                    
                        listaNombre.Add(peliculas.Nombre);                                   
                        arbolBPlusPeliculas.Insertar(listaNombre.ElementAt(i),JsonPeliculas.ElementAt(i));
                    }

                    //Validar que la pelicula a buscar exista dentro del catalogo.
                    string x1 = "";
                    bool BuscarEstado = false;
                    string PeliculaABuscar = buscar.IngresarNombrePelicula;
                    BuscarEstado = arbolBPlusPeliculas.Buscar(PeliculaABuscar, out x1);
                    if (BuscarEstado == true)
                    {
                        ViewBag.Message = ("La pelicula " + PeliculaABuscar + " SI se ha encontrado en la libreria de Guaflix");
                    }
                    else
                    {
                        ViewBag.Message = ("La pelicula " + PeliculaABuscar + " NO se encuentra en la libreria de Guaflix");
                    }

                }
             }
            else
            {
                ViewBag.Message = "Debe de ingresar el nombre de alguna pelicula para poder buscar.";
            }
               
            return View();
        }


        public ActionResult AgregarPeliculasOpenFile()
        {
            try
            {
                //OPEN FILE DIalog

                //Validar que el archivo sea valido.
                if (Request.Files.Count > 0)
                {
                    var file = Request.Files[0];

                    if (file != null && file.ContentLength > 0)
                    {
                        var fileName = Path.GetFileName(file.FileName);
                        var path = Path.Combine(Server.MapPath("~/App_Data/"), fileName);
                        file.SaveAs(path);
                        var contenido = System.IO.File.ReadAllText(path);
                        TempData["uploadResult"] = "Archivo subido con éxito";
                        TempData["file"] = contenido;
                    }
                }

                return View();
            }
            catch
            {
                return RedirectToAction("Contact","Home");
            }
        }
      
